import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import * as serviceWorker from './serviceWorker';

import 'tachyons';

ReactDOM.render(
  <React.StrictMode>
    <div>
      <Card />
      <Card />
      <Card />
      <Card />
    </div>

  </React.StrictMode>,
  document.getElementById('root')
);

serviceWorker.unregister();
